import React from 'react';
import { Link } from 'react-router-dom';
import { List } from 'semantic-ui-react';

export default class NavBar extends React.Component {
  render() {
    let style = {
      height: 70,
      backgroundColor: 'lightblue',
    };

    return (
      <div style={style}>
        <List>
          <List.Item>
            <Link to='/'>Kasino - Etusivu</Link>
          </List.Item>
          <List.Item>
            <Link to='/luotunnus'>Kasino - Luo tunnus</Link>
          </List.Item>
          <List.Item>
            <Link to='/saldo'>Kasino - Saldo</Link>
          </List.Item>
          <List.Item>
            <Link to='/kirjaudu'>Kasino - Kirjaudu</Link>
          </List.Item>
          <List.Item>
            <Link to='/admin'>Kasino - Admin</Link>
          </List.Item>
        </List>
      </div>
    );
  }
}
